#
# Upgrade configuration:
#   Binary v1: monerod-v1
#   Binary v2: monerod-v2
#   Upgrade order: sequential
#   Upgrade stagger: 30s
#
# Activity batching (prevents thundering herd):
#   Batch size: 5 users
#   Batch interval: 2m (+/-30% jitter)
#   Total rollout: ~38m
#
