#   t=15h 22m:     Last user spawns
#   t=29h:     Bootstrap ends (+20% buffer), distributor starts funding
#   t=30h:     Users start sending transactions (staggered over ~38m)
#   t=55h:     Network upgrade begins (nodes switch v1 -> v2)
#   t=63h 20m:    Last node completes upgrade
#   t=90h:    Simulation ends (post-upgrade observation)
# Batched bootstrap: 100 users in 5 batches
#   Batch 1: 5 users starting at 14h
#   Batch 2: 10 users starting at 14h 20m
#   Batch 3: 20 users starting at 14h 40m
#   Batch 4: 40 users starting at 15h
#   Batch 5: 25 users starting at 15h 20m
# Fast mode settings: runahead=100ms, shadow_log_level=warning, poll_interval=300, tx_interval=120

